import { React } from "react";
import { useSelector } from "react-redux";

const Login = () => {
  return <button>Login</button>;
};
const Profile = () => {
  const use = useSelector((state) => {
    state.user.value;
  });
  return (
    <div>
      <h1>Profile page</h1>
      <p>Name:{user.name}</p>
      <p>Height:{user.height}</p>
      <p>Age:{user.age}</p>
    </div>
  );
};
export const ReduxPractice = () => {
  return (
    <div>
      <Profile />
      <Login />
    </div>
  );
};
